import React from 'react';

import Resources from './Resources';
import Board from './Board';
import Buildings from './Buildings';
import Buttons from './Buttons';

import PatternDetector from './PatternDetector';


const App = () => {
  return (
    <div>
      <Resources />
      <Board />
      <Buildings />
      <Buttons />
      <PatternDetector />
    </div>
  );
}

export default App;
